export enum Actividad{
    sedentario = "Sedentario",
    ligero = "Ligero",
    moderado = "Moderado",
    intenso = "Intenso"
}

export enum Sexo{
    hombre = "Hombre",
    mujer = "Mujer"
}
export enum TipoDiabetes{
    tipo1 = "Tipo 1",
    tipo2 = "Tipo 2",
    gestacional = "Gestacional"
